exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.230book.net/book/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/id="list"[^>]*>/,/<\/div>\s*<\/div>/),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};